#Input: A DNA string Genome.
#Output: All integer(s) i minimizing Skewi (Genome) among all values of i (from 0 to |Genome|).

sequence = ""

def Minimum_Skew(sequence):
	sklist = [] #list to compare, easier
	index = 0
	genomec = 0
	genomeg = 0
	min_skew = 0
	for i in sequence:
		if i == 'C':
			genomec += 1
		if i == 'G':
			genomeg += 1
		index += 1
		numskew = genomeg-genomec
		if numskew < min_skew:
			sklist = [index]
			min_skew = numskew
		if numskew == min_skew and index not in sklist:
			sklist.append(index)	
	print(sklist)
Minimum_Skew(sequence)